import React from 'react';
import {YAxis, XYPlot, VerticalBarSeries} from 'react-vis';

function GraphDisplay(props) {
    return(
        <div key={props.stepInd}>
        <XYPlot 
            height={props.height} 
            width={props.width}
        >
        <YAxis />
            <VerticalBarSeries
                animation
                data={props.data} 
                colorType="literal"
                barWidth={0.75}
            />
      </XYPlot>
      </div>
    );
}

export default GraphDisplay;
